import TweetEmbed from 'react-tweet-embed'
import './Board.css'


export default function Board({number}) {
  return (
        
        <div className='cover'>
        <div id='tweet'><TweetEmbed tweetId= {number} options={{align: 'center'}}/></div>

        
       </div>
    )
}
